      | 353032 -> { ItemTypeData.id= 353032; name= "Swarm Launcher"; published= false; description= "A mid-range anti-material weapon, the shoulder-mounted rocket launcher provides infantry squads with the means to effectively engage armored vehicles and installation gun emplacements. With pre-launch lock-on capabilities and intelligent swarm missiles, it is a man-portable system able to deliver devastating payloads against material targets.   Key to its success is the swarm missile technology. Fired in salvos, each warhead is fitted with an onboard guidance controller, which introduces random deviations and unpredictable patterns into the swarm's flight path, allowing some, if not all, missiles in the salvo to defeat basic countermeasure systems."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 353129 -> { ItemTypeData.id= 353129; name= "M512-A Submachine Gun"; published= false; description= "Favoring function over form, the SMG is a lightweight, semi-automatic weapon designed for close-quarters combat. What it lacks in stopping power and accuracy it grossly overcompensates for with quantity. Designed to injure and impede, the hailstorm of bullets the SMG produces is most effective in tight spaces against multiple targets.  This original design is a paradigm of Minmatar construction. An inelegant, but reliable weapon solution that is simple to produce, easily repaired using almost any available materials, and provides comparable pound-for-pound performance with similar sub-automatic weapons. Although an unabashedly low-tech weapon, it excels at what it was designed for: killing anything right in front of you."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
