      | 50004 -> { ItemTypeData.id= 50004; name= "Nyx Federal Police SKIN"; published= true; description= "The federal Gallente Police Directorate traces its roots back to the original planet-wide police service of the Gallente Union on Luminaire. The Gallente Union Police & Public Safety Service (GUPPSS) was intended to operate as an  all union service , with its officers recruited and trained by the federal government of the Gallente Union. While retaining basic membership of the GUPPSS, and with some serving as federal police, most officers served in distinct units under the political oversight of member states.    The concept broke down as the Gallente Union expanded throughout space and evolved into the modern day Gallente Federation. As outlying systems, planets and colonies chose to wholly organize their own police forces, the  Guppies  were increasingly seen as an anachronism by the heavily-populated and powerful member states of Luminaire.    Ultimately, the homeworld states followed the example of the sovereign polities of the Gallente Federation and set up entirely independent police forces. The Gallente Union Police & Publice Safety Service became the Gallente Police Directorate, and found a new lease of life as a police force operating across Federation space with jurisdiction over federal domains. Detractors of this service still refer to it by the old nickname of  Guppies ."; marketGroupId= Some(1976); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
