      | 52429 -> { ItemTypeData.id= 52429; name= "Hurricane In Rust We Trust SKIN"; published= true; description= "This special nanocoating mimics a layer of oxidation products on the surface of the ship it is applied to for decorative effect. The allusion to used and repurposed ships from the early days of rebellion and subsequently the Republic's fleets celebrates the early days of Minmatar spaceship design and the considerable combat effectiveness of such craft. For many years past, Minmatar spaceship technology has developed to a high level with modern and powerful ships supplanting older designs, which themselves have been upgraded and improved many times over. Even so, the old slogan  In Rust We Trust  has the power to evoke pride and memories of the glory days of Minmatar guerilla warfare and liberation."; marketGroupId= Some(1959); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52720 -> { ItemTypeData.id= 52720; name= "Federation Navy Comet Inner Zone Vanguard SKIN"; published= true; description= "Inner Zone Shipping has increased its internal security forces in the wake of the instability and increased threats to space travel posed by pirate activity, Drifter attacks and the Triglavian invasion.    The Inner Zone Vanguard clear shipping routes of likely threats and provide a rapid response should IZS transports be attacked."; marketGroupId= Some(2000); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 53011 -> { ItemTypeData.id= 53011; name= "Golem Malagrin Marshlight SKIN"; published= true; description= "The vast low-lying deltas and marshy plains of Luminaire's Western Morthane region have a long and dark history in folklore and in the ancient warring states period of the Gallente home world's past. Inhabitants on the periphery of the Great Morthani Wastes have many legends of spirits of light and flame seen wandering the swamps and several of these are feared as devils and demonic beings.    The Western Morthani natives called the most-feared of these spirits the  Boitata , and believed it to be a fiery serpent with a penchant for consuming the eyes of the dead and perhaps even the sinful living. Garouni settlers on the far western edge of the Great Wastes called this legendary demon  Malagrin  and also noted the tendency for livestock drowned in the marshes to attract these eery lights.    Military disaster is also a feature of the history of the Great Morthani Wastes. In its epic campaign to overthrow the ancient slaveholder Empire of Morthane, the Garoun Empire made several attempts to bypass the blistering deserts of Southern Morthane by marching armies through the western swamps. The legions of Garoun failed to penetrate the grim marshlands at every try, giving up on the route after an entire army, wracked by disease and starvation was destroyed by Morthani raiders at the south-eastern edge of the great wastes.    Some tales are told of lights dancing on the corpses of the lost soldiers of Garoun and this has become part of the Malagrin and Boitata legends on either side of the vast swamps."; marketGroupId= Some(2025); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 53205 -> { ItemTypeData.id= 53205; name= "Rhea Zento Isideko Combine SKIN"; published= true; description= "Now owned by the Sukuuvestaa megacorp, the Zento Isideko Combine represents the final fate of an old industrial concern from the early corporate era of Caldari society. Founded in the wave of corporate developments and consolidations of earlier business forms in the decades that followed first contact with the Gallente, Zento Isideko Combine was typical in its aspiration to become an interplanetary conglomerate in an era of enormous cultural and technological upheaval for the Caldari people.    Led by their visionary founder Foss Kriistavaa, the Zento Isideko Combine rapidly became a leader in the construction of advanced transportation links across Caldari Prime and eventually realized the founding ambition of becoming an space-industrial powerhouse. Zento Isideko maintained its place in the upper tier of Caldari corporations for nearly 200 years, until the <i>Third Sontogi Oskkaltiovone</i>* of 22714 AD brought it within the sphere of a corporate grouping that would eventually become the Sukuuvestaa Corporation.    After various corporate permutations over the centuries, the business is generally known as SuVee ZenIko on the stock markets. Even so, the old Zento Isideko Combine brand and livery is still used to distinguish the support fleets of the transportation construction, maintenance and security operations that the division carries out across the extensive holdings of Sukuuvestaa.    (<i>Sontogi Oskkaltiovone</i> – loosely translated: rules-based corporate war of takeovers)"; marketGroupId= Some(2096); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
