      | 55921 -> { ItemTypeData.id= 55921; name= "TES Uriam of Fiery Heart"; published= false; description= "Royal Heirs that commit ritual suicide in accordance with the Rite of Shathol'Syn are considered to have sacrificed their lives for the Amarr faith in order to usher in the reign of a new emperor. Such lords and ladies of the Great Houses of the Amarr Empire attain a saintly status by their sacrifice. Royal Heir Uriam Kador was well-known as a man of deep passions that made him a rather impulsive leader of House Kador. Uriam's most notorious act was to order an incursion into the Gallente Federation by the Kador Fleet in late YC110. The ensuing military disaster and its aftermath greatly diminished the prestige of House Kador, though it has been restored in large part by the efforts of his successor, Lady Hamideh Kador. "; marketGroupId= None; groupId= 226; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 6800.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(2910); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 6800.000000; volume= 0.000000 } |> Some
